import React from "react";
import Layout from "./components/Layout";
import { Route, Routes } from "react-router-dom";

const App = () => {
  return (
    <div>
      

      <Routes>
        <Route path="/" element={<Layout />}>
          <Route index />
        </Route>
      </Routes>
    </div>
  );
};

export default App;
